import React from "react";
import { BrowserRouter as Router, withRouter, NavLink } from 'react-router-dom';
import { Nav, NavItem, Navbar } from 'react-bootstrap'

import "../navigation/navigation.css";

class CommunicatorNavigation extends React.Component {
  render() {
    return (
      <Nav id="navigation" className="navbar navbar-inverse navbar-expand-lg menu-background sht-navbar">
          <Navbar id="myNavbar" className="collapse navbar-collapse">
            <NavItem><NavLink href="#">Home</NavLink></NavItem>
            <NavItem><NavLink href="#">Link 1</NavLink></NavItem>
            <NavItem><NavLink href="#">Link 2</NavLink></NavItem>
            <NavItem><NavLink href="#">Link 3</NavLink></NavItem>
          </Navbar>
      </Nav>
    )
  }
} 

export default withRouter(CommunicatorNavigation);
